import "./password.css";


const ResetPasswordComponent = () => {
  return (
     <div className="fullpage">
        {/* <div className="col text-center"> */}
        <Card.Img className="imgup" src={Up} />
        <div></div>
    <div className="fullpage">
      <div className="passw">
      <h2 className="reseting">Reset Password</h2>   
     </div>

      
      <div>
        <input className="pass-field2" type="text" name="otp"   placeholder="Enter your new password"/>
      </div>

      
      <div>
        <input className="pass-field3" type="text" name="otp"   placeholder="Retype your new password"/>
        
      </div>
      </div>
      
        <Card.Img className="imgdown" src={Down} />
      </div>
    
  );
}

export default ResetPasswordComponent;
